INSERT INTO `jdn_snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES 
(1, 'Example HTML shortcode', 'This is an example snippet for demonstrating how to add an HTML shortcode.\n\nYou can remove it, or edit it to add your own content.', '\nadd_shortcode( \'shortcode_name\', function () {\n\n	$out = \'<p>write your HTML shortcode content here</p>\';\n\n	return $out;\n} );', 'shortcode', 'global', 10, 0, '2022-01-31 15:42:30'),
(2, 'Example CSS snippet', 'This is an example snippet for demonstrating how to add custom CSS code to your website.\n\nYou can remove it, or edit it to add your own content.', '\nadd_action( \'wp_head\', function () { ?>\n<style>\n\n	/* write your CSS code here */\n\n</style>\n<?php } );\n', 'css', 'front-end', 10, 0, '2022-01-31 15:42:30'),
(3, 'Example JavaScript snippet', 'This is an example snippet for demonstrating how to add custom JavaScript code to your website.\n\nYou can remove it, or edit it to add your own content.', '\nadd_action( \'wp_head\', function () { ?>\n<script>\n\n	/* write your JavaScript code here */\n\n</script>\n<?php } );\n', 'javascript', 'front-end', 10, 0, '2022-01-31 15:42:30'),
(4, 'Order snippets by name', 'Order snippets by name by default in the snippets table.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'name\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2022-01-31 15:42:30'),
(5, 'Order snippets by date', 'Order snippets by last modification date by default in the snippets table.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'modified\';\n} );\n\nadd_filter( \'code_snippets/list_table/default_order\', function () {\n	return \'desc\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2022-01-31 15:42:30'),
(6, 'show_subscription', '', 'add_shortcode(\'wdm_my_subscription\', \'wmd_my_custom_function\');\r\nfunction wmd_my_custom_function(){\r\n    WC_Subscriptions::get_my_subscriptions_template();\r\n}\r\n', '', 'global', 10, 1, '2022-01-31 21:23:38'),
(7, 'test_redi', '', 'add_action(\'template_redirect\', \'woo_custom_redirect_after_purchase\');\r\nfunction woo_custom_redirect_after_purchase() {\r\n    global $wp;\r\n	\r\n	$users_subscriptions = wcs_get_users_subscriptions($user_id);\r\n\r\n   foreach ($users_subscriptions as $subscription){\r\n  if ($subscription->has_status(array(\'active\'))) {\r\n         echo $subscription->get_id(); \r\n  }\r\n}\r\n\r\n}', '', 'global', 10, 1, '2022-01-31 23:42:44'),
(8, 'new_api_token', '', 'function new_api_token_path(){\r\n	 register_rest_route(\'hollejo/generate\', \'token\', array(\r\n            \'methods\' => \'POST\',\r\n		 \'callback\' => \'generate_token\',\r\n        ));\r\n	\r\n	function generate_token($request)\r\n    {\r\n		\r\n		\r\n		\r\n		$secret_key = defined(\'JWT_AUTH_SECRET_KEY\') ? JWT_AUTH_SECRET_KEY : false;\r\n		$username = sanitize_text_field( $request->get_param(\'username\') ) ;\r\n        $password = sanitize_text_field( $request->get_param(\'password\') );\r\n\r\n		$memberID = get_user_by( \'email\', $username );\r\n		$data[\'id\']=$memberID->ID;\r\n		$data[\'roles\']=$memberID->roles;\r\n		$data[\"user_email\"]=$memberID->user_email;		\r\n		$userPassHash = $memberID->user_pass;\r\n		$data_1[\'md5\'] = wp_hash_password($password);\r\n\r\n		\r\n		\r\n		if(!$secret_key) {\r\n            return new WP_Error(\r\n                \'jwt_auth_bad_config\',\r\n                __(\'JWT is not configurated properly, please contact the admin\', \'wp-api-jwt-auth\'),\r\n                array(\r\n                    \'status\' => 403,\r\n                )\r\n            );\r\n        }\r\n		\r\n\r\n		$wp_hasher = new PasswordHash(8, TRUE);\r\n\r\n		if($wp_hasher->CheckPassword($password , $userPassHash)) {\r\n			\r\n			/**********************************INICIO**********************/\r\n			\r\n			$apiExists = WP_Application_Passwords::application_name_exists_for_user($data[\'id\'], \'api\' );\r\n		\r\n			if($apiExists){\r\n				$passAplication = get_user_meta( $data[\'id\'] , \'applicationPassword\' , true );\r\n				$user = wp_authenticate($data[\'user_login\'], $passAplication );			\r\n			}else{\r\n				$applicationPasswordscreate = 	\r\n				WP_Application_Passwords::create_new_application_password($data[\'id\'], 		                                       array(\'name\'=>\'api\'));	\r\n				$Passwordscreate = $applicationPasswordscreate[0];		\r\n				update_user_meta( $data[\'id\'], \'applicationPassword\', $Passwordscreate );			\r\n				$user = wp_authenticate($data[\'user_login\'], $Passwordscreate );			\r\n			}\r\n		\r\n				\r\n			$issuedAt = time();\r\n			$notBefore = apply_filters(\'jwt_auth_not_before\', $issuedAt, $issuedAt);\r\n			$expire = apply_filters(\'jwt_auth_expire\', $issuedAt + (DAY_IN_SECONDS * 7), $issuedAt);\r\n\r\n			$token = array(\r\n				\'iss\' => get_bloginfo(\'url\'),\r\n				\'iat\' => $issuedAt,\r\n				\'nbf\' => $notBefore,\r\n				\'exp\' => $expire,\r\n				\'data\' => array(\r\n					\'user\' => array(\r\n						\'id\' => $user->data->ID,\r\n					),\r\n				),\r\n			);\r\n\r\n				\r\n			$data[\'token\'] = JWT::encode(apply_filters(\'jwt_auth_token_before_sign\', $token, $user),$secret_key);		\r\n\r\n			wp_send_json_success($data);\r\n\r\n			/**********************************FIN**********************/\r\n			\r\n		} else {\r\n			wp_send_json_success(\'Usuario o contrasea invalida\' , 401 );\r\n		}\r\n		\r\n		\r\n	}\r\n\r\n}\r\n\r\nadd_action(\'rest_api_init\' , \'new_api_token_path\');', '', 'global', 10, 1, '2022-02-03 19:25:48'),
(9, 'get_user_info_by_email', '', 'add_action( \'rest_api_init\', function () {\r\n    register_rest_route( \'customapis/v2\', \'getToken\', array(\r\n      \'methods\' => \'POST\',\r\n      \'callback\' => \'getToken\',\r\n    ) );\r\n} );\r\n\r\nfunction getToken(WP_REST_Request $request) {\r\n	\r\n	$parameters = $request->get_params();\r\n	\r\n	$dataUser = array();\r\n	\r\n	if( !$parameters[\'email\'] ) {// Se verifica que exista la variable email\r\n		$response = new WP_REST_Response(array(\'message\'=>\'Successful\', \'data\'=>  false ));\r\n		$response->set_status(200);\r\n		return $response;\r\n	}\r\n	\r\n	$userEmail = $parameters[\'email\'];\r\n	\r\n	$userdata = get_user_by( \'email\', $userEmail );\r\n	\r\n	$userMetaData = get_user_meta ( $userdata->ID );\r\n	\r\n	$dataUser = (object) array(\r\n		\'user_id\' => $userdata->ID\r\n	);\r\n	\r\n	$response = new WP_REST_Response(array(\'message\'=>\'Successful\', \'data\'=> $dataUser ));\r\n	$response->set_status(200);\r\n	return $response;\r\n	\r\n}', '', 'global', 10, 1, '2022-02-03 22:42:31');
