INSERT INTO `jdn_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `is_read`, `icon`) VALUES 
(1, 'stripe_applepay_holiday2021', 'marketing', 'en_US', 'Boost sales this holiday season with Apple Pay!', 'Increase your conversion rate by letting your customers know that you accept Apple Pay. Its seamless to <a href=\"https://docs.woocommerce.com/document/stripe/?_ga=2.90941597.642705274.1635776464-1391993999.1621950839#apple-pay\">enable Apple Pay with Stripe</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(2, 'square_applepay_holiday2021', 'marketing', 'en_US', 'Boost sales this holiday season with Apple Pay!', 'Increase your conversion rate by letting your customers know that you accept Apple Pay. Its seamless to <a href=\"https://docs.woocommerce.com/document/woocommerce-square/?_ga=2.90941597.642705274.1635776464-1391993999.1621950839#section-14\">enable Apple Pay with Square</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(3, 'wcpay_applepay_holiday2021', 'marketing', 'en_US', 'Boost sales this holiday season with Apple Pay!', 'Increase your conversion rate by letting your customers know that you accept Apple Pay. Its seamless to <a href=\"https://docs.woocommerce.com/document/payments/apple-pay/\">enable Apple Pay with WooCommerce Payments</a> and easy to communicate it with this <a href=\"https://developer.apple.com/apple-pay/marketing/\">marketing guide</a>.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(4, 'new_in_app_marketplace_2021', 'info', 'en_US', 'Customize your store with extensions', 'Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.', '{}', 'unactioned', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(5, 'wayflyer_bnpl_q4_2021', 'marketing', 'en_US', 'Grow your business with funding through Wayflyer', 'Fast, flexible financing to boost cash flow and help your business grow  one fee, no interest rates, penalties, equity, or personal guarantees. Based on your stores performance, Wayflyer provides funding and analytical insights to invest in your business.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(6, 'wc_shipping_mobile_app_usps_q4_2021', 'marketing', 'en_US', 'Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App', 'Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(7, 'wc_shipping_mobile_app_q4_2021', 'marketing', 'en_US', 'Print and manage your shipping labels with the WooCommerce Mobile App', 'Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(8, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(9, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(10, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requestscustomers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(11, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(12, 'your-first-product', 'info', 'en_US', 'Your first product', 'Thats huge! Youre well on your way to building a successful online store  now its time to think about how youll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(13, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'Its crucial to get your stores checkout as smooth as possible to avoid losing sales. Lets take a look at how you can optimize the checkout experience for your shoppers.', '{}', 'unactioned', 'woocommerce.com', '2022-01-31 02:39:21', NULL, 0, 'plain', '', 0, 0, 'info'),
(14, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, weve put together this short list of the first few things you should customize in WooCommerce.', '{}', 'unactioned', 'woocommerce.com', '2022-01-30 14:50:41', NULL, 0, 'plain', '', 0, 0, 'info'),
(15, 'wc-payments-qualitative-feedback', 'info', 'en_US', 'WooCommerce Payments setup - let us know what you think', 'Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(16, 'share-your-feedback-on-paypal', 'info', 'en_US', 'Share your feedback on PayPal', 'Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(17, 'google_listings_and_ads_install', 'marketing', 'en_US', 'Drive traffic and sales with Google', 'Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(18, 'wc-subscriptions-security-update-3-0-15', 'info', 'en_US', 'WooCommerce Subscriptions security update!', 'We recently released an important security update to WooCommerce Subscriptions. To ensure your sites data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(19, 'woocommerce-core-update-5-4-0', 'info', 'en_US', 'Update to WooCommerce 5.4.1 now', 'WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(20, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'wcpay-promo-2020-11', 'wcpay-promo-2020-11', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(21, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'wcpay-promo-2020-12', 'wcpay-promo-2020-12', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(22, 'wcpay-promo-2021-6-incentive-1', 'marketing', 'en_US', 'Simplify the payments process for you and your customers with WooCommerce Payments', 'With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay, and recurring revenue in over 100 currencies.\n				Built into your stores WooCommerce dashboard, track cash flow and manage all of your transactions in one place  with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(23, 'wcpay-promo-2021-6-incentive-2', 'marketing', 'en_US', 'Simplify the payments process for you and your customers with WooCommerce Payments', 'With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay, and recurring revenue in over 100 currencies.\n				Built into your stores WooCommerce dashboard, track cash flow and manage all of your transactions in one place  with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(24, 'ppxo-pps-upgrade-paypal-payments-1', 'info', 'en_US', 'Get the latest PayPal extension for WooCommerce', 'Heads up! Theres a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(25, 'ppxo-pps-upgrade-paypal-payments-2', 'info', 'en_US', 'Upgrade your PayPal experience!', 'Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(26, 'woocommerce-core-sqli-july-2021-need-to-update', 'update', 'en_US', 'Action required: Critical vulnerabilities in WooCommerce', 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(27, 'woocommerce-blocks-sqli-july-2021-need-to-update', 'update', 'en_US', 'Action required: Critical vulnerabilities in WooCommerce Blocks', 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(28, 'woocommerce-core-sqli-july-2021-store-patched', 'update', 'en_US', 'Solved: Critical vulnerabilities patched in WooCommerce', 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(29, 'woocommerce-blocks-sqli-july-2021-store-patched', 'update', 'en_US', 'Solved: Critical vulnerabilities patched in WooCommerce Blocks', 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(30, 'habit-moment-survey', 'marketing', 'en_US', 'Were all ears! Share your experience so far with WooCommerce', 'Wed love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(31, 'ecomm-wc-navigation-survey', 'info', 'en_US', 'Wed like your feedback on the WooCommerce navigation', 'Were making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.', '{}', 'pending', 'woocommerce.com', '2022-01-27 19:45:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(32, 'wc-admin-complete-store-details', 'info', 'en_US', 'Para completar la configuracin, debes aadir los datos de tu tienda.', 'Completa los datos de tu tienda con informacin importante para la configuracin, como la direccin base.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-27 19:45:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(33, 'wc-refund-returns-page', 'info', 'en_US', 'Setup a Refund and Returns Policy page to boost your store\'s credibility.', 'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.', '{}', 'unactioned', 'woocommerce-core', '2022-01-27 19:45:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(35, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Conectar con WooCommerce.com', 'Conctate para recibir avisos y actualizaciones importantes de productos.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-27 19:45:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(36, 'storefront-customize', 'info', 'en_US', 'Disea tu tienda con Storefront ', 'Visita la pgina de ajustes de Storefront para empezar a configurar y personalizar tu tienda.', '{}', 'unactioned', 'storefront', '2022-01-27 19:49:15', NULL, 0, 'plain', '', 0, 0, 'info'),
(37, 'wc-admin-learn-more-about-variable-products', 'info', 'en_US', 'Aprende ms sobre productos variables', 'Los productos variables son un tipo de producto muy potente, que te permite ofrecer un conjunto de variaciones de un producto, con el que controlas los precios, inventario, imagen y ms para cada variacin. Pueden usarse para un producto como una camisa, donde puedes ofrecerla grande, mediana y pequea, y en distintos colores.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-27 22:10:57', NULL, 0, 'plain', '', 0, 0, 'info'),
(38, 'wc-admin-orders-milestone', 'info', 'en_US', 'Primer pedido recibido', 'Felicidades por conseguir tu primer pedido! Ahora es un buen momento para aprender cmo gestionar tus pedidos.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-28 16:47:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(39, 'wc-admin-woocommerce-subscriptions', 'marketing', 'en_US', 'Necesita ms informacin sobre WooCommerce Subscriptions?', 'WooCommerce Suscriptions te permiten introducir una variedad de suscripciones para productos y servicios fsicos o virtuales. Crea clubes de productos del mes, suscripciones de servicios semanales o incluso paquetes de facturacin de software anuales. Aade tarifas de registro, ofrece periodos de prueba gratuitos o establece perodos de vencimiento.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-28 22:00:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(40, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ests preparado para lanzar tu tienda?', 'Para asegurarnos de que nunca tengas esa sensacin de \"Qu se me olvid?\" hemos preparado la lista de comprobacin esencial de despegue.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-28 22:00:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(41, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Elegimos un tema?', 'Echa un vistazo a los temas compatibles con WooCommerce y elige uno alineado con tu marca y las necesidades de tu negocio.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-28 22:00:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(42, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', 'Detalles', 'Ms del 80% de los nuevos vendedores aaden el primer producto y tienen configurado al menos un mtodo de pago durante la primera semana. <br><br>Encontraste til este tipo de consejo?', '{}', 'unactioned', 'woocommerce-admin', '2022-01-28 22:00:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(43, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicacin mvil WooCommerce', 'Instala la aplicacin mvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver mtricas clave all donde ests.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-30 14:50:41', NULL, 0, 'plain', '', 0, 0, 'info'),
(44, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Cmo personalizar tu catlogo de productos', 'Quieres que tu catlogo de productos y tus imgenes tengan un aspecto estupendo y estn en consonancia con tu marca. Esta gua te dar todos los consejos que necesitas para que tus productos se vean bien en tu tienda.', '{}', 'unactioned', 'woocommerce-admin', '2022-01-30 14:50:41', NULL, 0, 'plain', '', 0, 0, 'info'),
(45, 'wc-admin-new-sales-record', 'info', 'en_US', 'Nuevo rcord de ventas!', 'Woohoo, January 31st was your record day for sales! Net sales was 39,00 beating the previous record of 12,00 set on January 30th.', '{\"old_record_date\":\"2022-01-30\",\"old_record_amt\":12,\"new_record_date\":\"2022-01-31\",\"new_record_amt\":39}', 'unactioned', 'woocommerce-admin', '2022-02-01 19:46:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(46, 'wc-admin-marketing-intro', 'info', 'en_US', 'Conecta con tu audiencia', 'Aumenta tu base de clientes e incrementa tus ventas con las herramientas de marketing creadas para WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2022-02-01 19:46:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(47, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Ayuda a WooCommerce a mejorar con el seguimiento de uso', 'Recopilar datos de uso nos permite mejorar WooCommerce. Se tendr en cuenta a tu tienda a medida que evaluamos nuevas caractersticas, juzgamos la calidad de una actualizacin o determinamos si una mejora tiene sentido. Siempre puedes visitar los <a href=\"https://sub.tonofu.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Ajustes</a> y elegir dejar de compartir datos. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Lee ms</a> sobre los datos que recopilamos.', '{}', 'unactioned', 'woocommerce-admin', '2022-02-03 21:51:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(48, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Sabas que?', 'Una tienda que funciona con WooCommerce necesita un promedio de 31 das para conseguir su primera venta. Ests en el camino correcto! Encontraste til este tipo de estadstica?', '{}', 'unactioned', 'woocommerce-admin', '2022-02-03 21:51:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(49, 'wc_simple_payments_m2_reader_launch_q1_2022', 'marketing', 'en_US', 'Take quick and easy in-person payments', 'WooCommerce is continuing to power up your business with our new Simple Payments feature, built exclusively for WooCommerce In-Person Payments. Capture quick and simple payments anywhere else your customers are  or offer a local pickup option with payment taken in-person for orders placed online.', '{}', 'pending', 'woocommerce.com', '2022-02-04 22:19:00', NULL, 0, 'plain', '', 0, 0, 'info'),
(50, 'wcpay_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with Apple Pay  just like Diane does', 'See how Diane from <a href=\"https://woocommerce.com/posts/lady-dye-yarns-from-crafts-to-activism-with-woocommerce/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Lady Dye Yarns</a> uses Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too  Apple Pay is included in WooCommerce Payments. Here\'s how you can increase conversions by encouraging shoppers to pay with a single tap.', '{}', 'pending', 'woocommerce.com', '2022-02-10 01:37:08', NULL, 0, 'plain', '', 0, 0, 'info'),
(51, 'stripe_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with Apple Pay  just like Thomas does', 'Read the inspirational story of <a href=\"https://woocommerce.com/posts/incredible-story-of-thomas-trendy-socks-down-syndrome-entrepreneur/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Thomas\'s Trendy Socks</a> and see how hes using Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too  ready to turn more visitors into buyers? Accept Apple Pay by selecting Enable express checkouts in Settings &gt; Payments &gt; Stripe.', '{}', 'pending', 'woocommerce.com', '2022-02-10 01:37:08', NULL, 0, 'plain', '', 0, 0, 'info'),
(52, 'square_applepay_q1_2022', 'marketing', 'en_US', 'Increase conversions with a faster checkout experience', 'By enabling Apple Pay in Square, your customers can complete purchases quickly and securely with a single touch or a glance  no lengthy checkout forms necessary. Accept Apple Pay by enabling Digital Wallets within Settings &gt; Payments &gt; Square.', '{}', 'pending', 'woocommerce.com', '2022-02-10 01:37:08', NULL, 0, 'plain', '', 0, 0, 'info');
